import React from "react";
import { Card } from "../../Card.styled";
import { CardInline } from "../../Card.styled2";
const NavBar = ({ content }) => {
  return (
    <>
      <Card
        dp={"grid"}
        gridC={"45% 35% 20%"}
        bd={"1px solid black"}
        height={"1.5rem"}
        mg={"2rem"}
      >
        <Card dp={"grid"} gridC={"auto auto auto auto"} bd={"1px solid red"}>
          <Card bd={"1px solid black"}>{content.NavBarContents[0]}</Card>
          <Card fs={"0.5rem"} bd={"1px solid black"}>
            {content.NavBarContents[1]}
          </Card>
          <Card fs={"0.5rem"} bd={"1px solid black"}>
            {content.NavBarContents[2]}
          </Card>
          <Card fs={"0.5rem"} bd={"1px solid black"}>
            {content.NavBarContents[3]}
          </Card>
        </Card>
        <Card bd={"1px solid red"}></Card>
        <Card bd={"1px solid red"}></Card>
      </Card>
    </>
  );
};

export default NavBar;
